

import React, { useState, useRef, useEffect } from 'react';
import { SunIcon, MoonIcon, ArrowRightOnRectangleIcon, Bars3Icon } from './icons'; // Importar Bars3Icon
import { User } from '../types';

const logoBase64 = 'data:image/png;base64,';

// CSS for the shimmer effect
const shimmerStyle = `
@keyframes shimmer {
    0% { background-position: -1000px 0; }
    100% { background-position: 1000px 0; }
}
.animate-shimmer {
    background: linear-gradient(to right, #9333ea 20%, #38bdf8 40%, #818cf8 60%, #9333ea 80%);
    background-size: 200% auto;
    color: transparent;
    background-clip: text;
    -webkit-background-clip: text;
    animation: shimmer 5s linear infinite;
}
`;

interface HeaderProps {
    theme: 'light' | 'dark';
    onToggleTheme: () => void;
    user: User | null;
    onLogout: () => void;
    onToggleSidebar: () => void; // Nova prop para o sidebar
}

const Header: React.FC<HeaderProps> = ({ theme, onToggleTheme, user, onLogout, onToggleSidebar }) => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const menuRef = useRef<HTMLDivElement>(null);

     useEffect(() => {
        const handleClickOutside = (event: MouseEvent) => {
            if (menuRef.current && !menuRef.current.contains(event.target as Node)) {
                setIsMenuOpen(false);
            }
        };
        document.addEventListener("mousedown", handleClickOutside);
        return () => document.removeEventListener("mousedown", handleClickOutside);
    }, []);

    return (
        <>
            <style>{shimmerStyle}</style>
            <header className="bg-white/80 dark:bg-gradient-to-b dark:from-slate-900/90 dark:to-slate-900/70 backdrop-blur-xl border-b border-gray-200/80 dark:border-slate-800/50 p-4 sticky top-0 z-50 transition-colors duration-300 shadow-sm dark:shadow-md dark:shadow-black/30 animate-slide-down-fade-in">
                <div className="container mx-auto flex items-center justify-between gap-4">
                    <div className="flex items-center gap-4">
                        {user && ( // Mostra o boto do menu apenas se o usurio estiver logado
                            <button
                                onClick={onToggleSidebar}
                                className="p-2 rounded-full text-gray-500 dark:text-gray-400 hover:bg-gray-200 dark:hover:bg-slate-800 transition-colors md:hidden"
                                aria-label="Abrir menu principal"
                            >
                                <Bars3Icon className="w-6 h-6" />
                            </button>
                        )}
                        <img src={logoBase64} alt="CortexPrepExam Logo" className="w-10 h-10" />
                        <div>
                             <h1 className="text-xl font-bold tracking-tight animate-shimmer">Cortex MyF*ck-IT-Exam</h1>
                             <p className="text-sm text-gray-500 dark:text-slate-400 fade-in" style={{animationDelay: '100ms'}}>Domine sua certificao com simulados gerados por Agentes IA Autnomos.</p>
                        </div>
                    </div>
                    <div className="flex items-center gap-2">
                         <button
                            onClick={onToggleTheme}
                            className="p-2 rounded-full text-gray-500 dark:text-gray-400 hover:bg-gray-200 dark:hover:bg-slate-800 transition-colors"
                            aria-label={`Switch to ${theme === 'light' ? 'dark' : 'light'} mode`}
                        >
                            {theme === 'light' ? <MoonIcon className="w-6 h-6" /> : <SunIcon className="w-6 h-6" />}
                        </button>
                        {user && (
                             <div className="relative" ref={menuRef}>
                                <button onClick={() => setIsMenuOpen(!isMenuOpen)} className="p-2 rounded-full text-gray-500 dark:text-gray-400 hover:bg-gray-200 dark:hover:bg-slate-800 transition-colors">
                                    <img src={`https://api.dicebear.com/8.x/initials/svg?seed=${user.email}`} alt="User avatar" className="w-6 h-6 rounded-full" />
                                </button>
                                {isMenuOpen && (
                                     <div className="absolute right-0 mt-2 w-48 bg-white dark:bg-slate-800 rounded-md shadow-lg py-1 border border-gray-200 dark:border-slate-700 fade-in z-20">
                                         <div className="px-4 py-2 text-sm text-gray-700 dark:text-gray-300 border-b border-gray-200 dark:border-slate-700">{user.email}</div>
                                        <button onClick={onLogout} className="w-full text-left flex items-center gap-2 px-4 py-2 text-sm text-red-600 dark:text-red-400 hover:bg-gray-100 dark:hover:bg-slate-700">
                                            <ArrowRightOnRectangleIcon className="w-4 h-4"/>
                                            Logout
                                        </button>
                                    </div>
                                )}
                             </div>
                        )}
                    </div>
                </div>
            </header>
        </>
    );
};

export default Header;